import React from 'react';
import { Clock, CheckCircle, XCircle, AlertCircle, Eye } from 'lucide-react';

const TaskCard = ({ task, onViewDetails }) => {
  const getStatusIcon = (status) => {
    switch (status) {
      case 'completed':
        return <CheckCircle className="w-5 h-5 text-success-500" />;
      case 'running':
        return <Clock className="w-5 h-5 text-warning-500 animate-spin" />;
      case 'failed':
        return <XCircle className="w-5 h-5 text-error-500" />;
      case 'created':
        return <AlertCircle className="w-5 h-5 text-primary-500" />;
      default:
        return <Clock className="w-5 h-5 text-gray-400" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'completed':
        return 'bg-success-50 text-success-700 border-success-200';
      case 'running':
        return 'bg-warning-50 text-warning-700 border-warning-200';
      case 'failed':
        return 'bg-error-50 text-error-700 border-error-200';
      case 'created':
        return 'bg-primary-50 text-primary-700 border-primary-200';
      default:
        return 'bg-gray-50 text-gray-700 border-gray-200';
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  const getExecutionTime = () => {
    if (!task.completed_at) return null;
    const start = new Date(task.created_at);
    const end = new Date(task.completed_at);
    const diff = Math.round((end - start) / 1000);
    return `${diff}s`;
  };

  return (
    <div className="bg-white rounded-lg border border-gray-200 p-4 hover:shadow-md transition-shadow">
      <div className="flex items-start justify-between mb-3">
        <div className="flex items-center space-x-2">
          {getStatusIcon(task.status)}
          <div className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium border ${getStatusColor(task.status)}`}>
            {task.status.charAt(0).toUpperCase() + task.status.slice(1)}
          </div>
        </div>

        <button
          onClick={() => onViewDetails(task)}
          className="p-1 text-gray-400 hover:text-gray-600 transition-colors"
          title="View details"
        >
          <Eye className="w-4 h-4" />
        </button>
      </div>

      <div className="mb-3">
        <p className="text-sm text-gray-600 font-mono bg-gray-50 px-2 py-1 rounded">
          ID: {task.task_id.slice(0, 8)}...
        </p>
      </div>

      <div className="space-y-2 text-sm text-gray-600">
        <div>
          <span className="font-medium">Created:</span> {formatDate(task.created_at)}
        </div>

        {task.completed_at && (
          <div>
            <span className="font-medium">Completed:</span> {formatDate(task.completed_at)}
            {getExecutionTime() && (
              <span className="ml-2 text-xs bg-gray-100 px-2 py-0.5 rounded">
                {getExecutionTime()}
              </span>
            )}
          </div>
        )}

        {task.result && task.status === 'completed' && (
          <div className="mt-3 p-2 bg-success-50 rounded border border-success-200">
            <p className="text-xs text-success-700 font-medium mb-1">Result Preview:</p>
            <p className="text-xs text-success-600 line-clamp-2">
              {task.result.length > 100 ? `${task.result.slice(0, 100)}...` : task.result}
            </p>
          </div>
        )}

        {task.result && task.status === 'failed' && (
          <div className="mt-3 p-2 bg-error-50 rounded border border-error-200">
            <p className="text-xs text-error-700 font-medium mb-1">Error:</p>
            <p className="text-xs text-error-600 line-clamp-2">
              {task.result.length > 100 ? `${task.result.slice(0, 100)}...` : task.result}
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

export default TaskCard;
